import React, { Component } from 'react';

class Counter extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        return (
            <div>
                <p>Count:</p>
                <button>+</button>
                <button>-</button>
            </div>
        )
    }
}

export default Counter
